import React from "react";
import "./Home.css";
import Cover from "../../img/bg-soap.png";
import Tap from "../../img/ic-tap.png";
import Logo from "../../img/bg-log.jpg";
import Settings from "../../img/setting.png";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div
      className="Home"
      style={{
        backgroundImage: `url(${Coverr})`,
        backgroundPosition: "center",
        backgroundSize: "cover",
        backgroundRepeat: "no-repeat",
        width: "768px",
        height: "1366px",
      }}
    >
      <div className="back">
        <div class="center-top-text">
          <div className="settings">
            <img src={Settings} alt="" />
          </div>
          <div className="logo">
            <img src={Logo} alt="" />
          </div>
          <div className="reduce-text">Let's Reduce and Reuse plastics</div>{" "}
          <div className="backs">
            <Link to="/Lang">
              <img src={Tap} alt="" />
            </Link>
          </div>
        </div>

        <div class="center-bottom-text">Touch to start your refill process</div>
      </div>
    </div>
  );
};

export default Home;
